// import addIcon from '../resources/add.svg';
import addIcon from '../../../node_modules/bootstrap-icons/icons/plus-circle-fill.svg'; 
function AddNewCookieBtn(props){
    return(
        <div className= 'div-add-button position-fixed'>
            {/* <img type='button' class='btn btn-outline-light' src={addIcon}/> */}
            <button type='button' className= 'btn btn-outline-dark'>
                <img type='button' class='btn btn-outline-dark' src={addIcon}/>
            </button>
        </div>
    );
}

export default AddNewCookieBtn;
